import React, { useEffect } from "react";
import imageLoader from "../utilities/imageLoader";

const Gallery = ({ pathId }) => {
  let images = <p>Loading...</p>;
  useEffect(() => {
    images = imageLoader(pathId);
  });
  return <div>{images}</div>;
};

export default Gallery;
